import React, { Component } from 'react';

/**
 * The Home page.
 */
class Home extends Component {
    render() {
        return (
            <div>
                <h1>Welcome!</h1>
                <p>On this web site you can view a list of persons if you are authorized.</p>
            </div>
        );
    }
}

export default Home;
